/**
 * BrowseService
 * This service is responsible for browsing around a given array of content
 * based on its length.
 *
 */

//Retrieves the module KSA_Bladr.services, and adds a new services
angular.module('KSA_Bladr.services').
    service('BrowseService', function(){
        //Private methods and variables goes here
        var privates = {};
        privates.content = [];

        //Public methods and variables
        var pubs = {};

        pubs.currentStep = 0;
        pubs.currentPage = 0;

        pubs.setContent = function(newContent){
            if(newContent instanceof Array){
                privates.content = newContent;
                pubs.currentStep = 0;
            }
            else{
                throw ("Input content must be an array!");
            }
        };

        pubs.getCurrentContent = function(){
            return privates.content[pubs.currentStep];
        };

        pubs.getCurrentPage = function(){
            if(privates.content.length !== 0){
                //TODO: No page turning implemented. This always shows the first page
                return privates.content[pubs.currentStep]['images'][0];
            }

            return null;
        };

        pubs.getContent = function(){
            return privates.content;
        };

        pubs.resetContent = function(){
            privates.content = [];
        };

        pubs.contentLength = function(){
            return privates.content.length;
        };

        pubs.goToId = function(id){
            pubs.goTo(0);
            for(var i = 0; i < privates.content.length; i++){
                if(privates.content[i].id == id){
                    pubs.goTo(i+1);
                    return;
                }
            }

            pubs.currentStep = 0;
        };

        pubs.step = function(step){
            //Getting the real step within the range (length) of the content
            var realStep = step;

            //If the step is not within the bounderies, the "real" step is calculated
            if((step > privates.content.length || step < -privates.content.length) && privates.content.length > 0)
                realStep = step % privates.content.length;

            //The new step is set
            var newStep = pubs.currentStep + realStep;

            if(newStep >= privates.content.length){
                pubs.currentStep = -1 + realStep;
            }
            else if(newStep < 0){
                pubs.currentStep = privates.content.length + newStep;
            }
            else{
                pubs.currentStep = newStep;
            }

            if(privates.content.length === 0){
                pubs.currentPage = 0;
            }
            else{
                pubs.currentPage = pubs.currentStep+1;
            }
        };

        pubs.goTo = function(number){
            pubs.step(number-1-pubs.currentStep);
        };

        pubs.goToNext = function(){
            pubs.step(1);
        };

        pubs.goToPrevious = function(){
            pubs.step(-1);
        };

        pubs.goToFirst = function(){
            pubs.goTo(1);
        };

        pubs.goToLast = function(){
            pubs.goTo(pubs.contentLength());
        };

        return pubs;
    }
);

/**
 * MetadataFilterService
 * This service is responsible for retrieving and handling the metadata levels given in
 * the central configuration object, which this service depends on.
 * 
 * The main responsibilities are:
 * 1) Receive the levels of metadata from the server
 * 2) Receive the metadata for each level according to the settings
 *    (preset, typeahead, getallbyfilter) and filters given by other levels
 * 3) Report if all required filters is set
 * 4) Load image collections based on the filters set
 * 
 */ 

//Getting the main module
var app = angular.module('KSA_Bladr.services');

app.service('MetadataFilterService', function($http, URLBuilderService){
    //Private methods and variables goes here
    var privates = {};
    
    //Public methods and variables
    var pubs = {};
    
    //The level is the same as a possible filter. TODO: Change the name
    pubs.levels = [];
    pubs.metadataType = null;
    pubs.collection_id = null;
    
    
    pubs.setMetadataConfiguration = function(obj){
        if(obj.metadataType === null)
            throw "Metadatatype required";
        
        if(obj.levels.length === 0)
            throw "Metadata levels required";
        
        //Iterating through objects, checking if necessary parameters is set
        for (var index = 0; index < obj.levels.length; index++) {
            if(obj.levels[index].order === undefined || obj.levels[index].name === undefined || obj.levels[index].api_name === undefined)
                throw "Data missing in metadata levels";
        }
        
        pubs.levels = obj.levels;
        pubs.metadataType = obj.metadataType;
        
        pubs.metadataStructure = obj;
    };
    
    //Retrieving metadata levels for the given collection
    pubs.getMetadataLevels = function(id){
        $http.get('type=metadatalevels&collection=' + id)
        .success(function(data, status, headers) {
            pubs.levels = data.levels;
            
            pubs.levels.sort(function(a,b){return a.order-b.order});
            
            pubs.type = data.type;
        });
    };
    
    //Removing metadata filter
    pubs.removeFilter = function(filterToRemove){
        for(var i = 0; i < pubs.levels.length; i++){
            if(pubs.levels[i].api_name == filterToRemove.name)
                pubs.levels[i].filter_value = null;
        }
    };
    
    pubs.addFilter = function(newFilter){
        if(newFilter.name === undefined || newFilter.value === undefined)
            throw "New filter requires both name and value";
        
        for(var i = 0; i < pubs.levels.length; i++){
            if(pubs.levels[i].api_name == newFilter.name)
                pubs.levels[i].filter_value = newFilter.value;
        }
    };
    
    pubs.compareFilters = function(filter1, filter2){
        if(filter1 && !filter2)
            return false;
        
        if(!filter1 && filter2)
            return false;
            
        if(filter1 == filter2)
            return true;
            
        if(filter1.length !== filter2.length)
            return false;
        
        for(var i = 0; i<filter1.length;i++){
            var keyMatch = false;
            for(var j = 0; j<filter2.length;j++){
                if(JSON.stringify(filter2[j]) === JSON.stringify(filter1[i]))
                    keyMatch = true;
            }
            if(!keyMatch)
                return false;
        }
        
        return true;
    };
    
    /**
     *  Returns true if all required filters is set
     */ 
    pubs.canRetriveImages = function(){
        for(var i = 0; i<pubs.levels.length; i++){
            if(pubs.levels[i].filter_required && (
                !pubs.levels[i].hasOwnProperty('filter_value') || 
                pubs.levels[i].filter_value == null))
                return false;
        }
        
        return true;
    };
    
        
    /**
     * Gets images collections and the related metadata, based on the given filters
     * An image collection consists of an array of images (for example front and back)
     * and an array of metadata concerning the collection.
     * TODO: It is yet to be decided if metadata corresponds with the metadata levels,
     * or if this is given other places in the configuration object
     * 
     */ 
    pubs.getImageCollectionRequestURL = function(){
        var requestURL = "getImageCollections?collection=1&";
        
        if(!pubs.canRetriveImages())
            return false;
            
        for(var i = 0; i<pubs.levels.length; i++){
            if(pubs.levels[i].filter_value)
                requestURL = requestURL + pubs.levels[i].api_name + "=" + pubs.levels[i].filter_value + "&";
        }        
        
        if(requestURL == "getImageCollections?&collection=1"){
            return false;
        }
        
        requestURL = requestURL.substring(0,requestURL.length-1);
        
        return requestURL;
    };
    
    //Getting metadata for the given level based on the filters
    pubs.getMetadata = function(level){
        //TODO: Implement dynamic collection id
        var request = "collection=1&";
        //Creating the request based on the name and value of each filter
        for(var i = 0; i<pubs.levels.length; i++){
            if(pubs.levels[i].filter_value)
                request = request + pubs.levels[i].api_name + "=" + pubs.levels[i].filter_value + "&";
        }
        
        if(request != "collection=1&"){
            request = request.substring(0,request.length-1) + "&level=" + level;
        }
        else{
            return;
        }
        //Two cases:
        //Hierarchy: Delete data in every level below the given, and receiving data for the one level below the given
        //Flat: No data is loaded as it is supposed that all data is received at once???
        
        var givenLevel = 0;
        for(var j = 0;j<pubs.levels.length;j++){
            //If the data has not already been loaded, or the request is updated, the data is loaded
            if(pubs.levels[j].api_name === level && (pubs.levels[j].data == [] || pubs.levels[j].latest_request !== request)){
                givenLevel = j;
                $http.get(request)
                .success(function(data){
                    pubs.levels[j].data = data;
                    pubs.levels[j].latest_request = request;
                });      
                break;
            }
        }
        
        if(pubs.metadataType == 'hierarchy'){
            //Removing data below the given level if data is to be received from backend
            for(var k = givenLevel; k < pubs.levels.length; k++){
                if(pubs.levels[k].api_name !== false){
                    pubs.levels[k].data = [];
                }
            }
        }
    };
    
    return pubs;
});
/**
 *  The MetadataHandler service is used to share metadata between controllers, as well as configure til MetadataManagerService
 *  so it is always up to date according to selected collection etc.
 */

//Getting the main module
var app = angular.module('KSA_Bladr.services');

app.service('MetadataHandlerService', function(MetadataManagerService, BrowseService, $location){
    //Private methods and variables goes here
    var privates = {};

    //Public methods and variables
    var pubs = {};

    //A list of collections
    pubs.collections = [];
    //The current collection
    pubs.collection = {};
    //A list of objects loaded when searching
    pubs.itemsList = [];
    //The current item of the ojects list
    pubs.item = {};
    //A list of possible filters, including type and value, if any
    pubs.filters = [];
    //Wheter or not there is enough filters to perform a search
    pubs.canSearch = false;
    //Collection id
    pubs.collectionId = false;
    //Collection name
    pubs.collectionName = false;
    //Selected error report (id)
    pubs.selectedErrorReport = -1;
    //Error report message
    pubs.errorReportingStatus= "";
    //Current status
    pubs.status = "";

    pubs.currentPage = BrowseService.currentPage;

    var lastReceivedCollection = false;

    pubs.getCollections = function(){
         return MetadataManagerService.getCollections().then(function(value){
            pubs.collections = value;
            //Removes collections under test
            for(var i = 0; i< pubs.collections.length; i++){
                if(pubs.collections[i].test == true){
                    pubs.collections[i] = null;
                }
            }
         });
    };

    pubs.getCollection = function(id){
        if(id !== lastReceivedCollection){
            MetadataManagerService.config(id);
            lastReceivedCollection = id;
            pubs.collectionId = id;
            return MetadataManagerService.getCollectionInfo().then(function(value){
                pubs.collection = value;
                $location.search('collection', value.id);
                pubs.getLevelsAndValues(value.id);
            });
        }
    };

    pubs.getLevelsAndValues = function(collectionId){
        //Getting levels. When done, set filters and possible values. Some is to be loaded async
        return MetadataManagerService.getMetadataLevels(collectionId).then(function(levels){
            pubs.filters = [];
            var tempFilters = [];
            var promises = [];
            for(var i = 0; i< levels.length; i++){
                var curLevel = levels[i];
                var searchable = false;
                if(curLevel.gui_type == 'typeahead'){
                    searchable = true;
                }

                var possibleValues = curLevel.data || [];
                if(curLevel.searchable === true){
                    tempFilters.push({
                        'name' : curLevel.name,
                        'searchable' : searchable,
                        'placeholder': curLevel.gui_name,
                        'noResultsText' : 'Ingen resultater',
                        'helpText' : curLevel.gui_description,
                        filter_value: 0,
                        possibleValues: possibleValues
                    });


                    //Load data here?
                    if(curLevel.gui_type == 'typeahead' && (i== 0 || (levels[i-1] && levels[i-1].filter_value))){
                        MetadataManagerService.getMetadata(curLevel.name).then(function(nameAndData){
                            pubs.updatePossibleFilterValues(nameAndData.name, nameAndData.data);
                        });
                    }
                }
            }

            pubs.filters = tempFilters;
        });
    };

    pubs.updateFiltersSelectedValues = function(metadata){
        for(var i=0; i<pubs.filters.length;i++){
            if(metadata[pubs.filters[i].name])
                pubs.filters[i].filter_value = metadata[pubs.filters[i].name];
        }
    };

    pubs.updatePossibleFilterValues = function(level, data){
        for(var i = 0; i < pubs.filters.length; i++){
            if(pubs.filters[i].name == level){
                pubs.filters[i].possibleValues = data;
            }
        }
    };

    pubs.updateSelectedFilterValues = function(){
        for(var i = 0; i < pubs.filters.length; i++){
            if(pubs.filters[i].filter_value){
                var promise = MetadataManagerService.changeFilterValue(pubs.filters[i].name, pubs.filters[i].filter_value);
                if(promise){
                    promise.then(function(nameAndData){
                        if(nameAndData){
                            pubs.updatePossibleFilterValues(nameAndData.name, nameAndData.data);
                        }
                    });
                }
            }
            else{
                //Clear all levels possible values after this level
                for(var j = i+1; j < pubs.filters.length; j++){
                    pubs.filters[j].possibleValues = [];
                    pubs.filters[j].filter_value = undefined;
                }
            }
        }
    };

    /*pubs.changeFilter = function(filterName, value){
        if(value){
            //Get and apply filters
            MetadataManagerService.changeFilterValue(filterName, value);
            console.log('filter changed');
        }
    };*/

    pubs.checkSearch = function(){
        pubs.canSearch = MetadataManagerService.canRetrieveObjects();
    };

    pubs.search = function(itemId){
        //Loads the objects from server, and sets the content and length
        pubs.status = "Søger";
        //This is ugly! Syncronizing the two (!) filter arrays
        for(var i = 0; i < pubs.filters.length; i++){
            if(!pubs.filters[i].searchable || pubs.filters[i].filter_value == null || pubs.filters[i].filter_value == undefined){
                MetadataManagerService.levels[i].filter_value = null;

            }
            else{
                 MetadataManagerService.levels[i].filter_value = pubs.filters[i].filter_value;
            }
        }

        MetadataManagerService.getObjects().then(function(value){
            BrowseService.setContent(value);
            if(itemId){
                BrowseService.goToId(itemId);
            }
            else{
                BrowseService.step(0);
            }
            pubs.itemsList = BrowseService.getContent();
            pubs.updateItem();
            pubs.status = "";
        });
    };

    pubs.step = function(steps){
        BrowseService.step(steps);
        pubs.updateItem();
    };

    pubs.goToFirst = function(){
        BrowseService.goToFirst();
        pubs.updateItem();
    };

    pubs.goToLast = function(){
        BrowseService.goToLast();
        pubs.updateItem();
    };

    pubs.goToId = function(id){
        BrowseService.goTo(id);
        pubs.updateItem();
    };

    pubs.goToNumber = function(){
        BrowseService.goTo(pubs.currentPage);
        pubs.updateItem();
    };

    pubs.updateItem = function(){
        var newItem = {};
        newItem = BrowseService.getCurrentContent();
        pubs.errorReportingStatus = "";
        if(newItem){
            newItem.imageUrl = pubs.collection.image_type == "image" ? BrowseService.getCurrentPage() : BrowseService.getCurrentPage().replace("_files/", ".jpg");
            newItem.imageUrlPrint = pubs.collection.image_type == "image" ? BrowseService.getCurrentPage() : BrowseService.getCurrentPage().replace("_files/", "_thumb.jpg");

            newItem.metadataDescription = MetadataManagerService.getMetadataString(newItem.metadata);
            newItem.starbasRef = MetadataManagerService.getStarbasRef(newItem.metadata, pubs.collection.starbas_field_name);
            pubs.item = newItem;
            pubs.currentPage = BrowseService.currentPage;

            $location.search('item', newItem.id);
            newItem.permaLink = $location.absUrl();
        }
        else{
            console.log("Could not get current content in updateItem()");
        }
    };

    pubs.rebuildByItem = function(itemId){
        MetadataManagerService.getObject(itemId).then(function(data){
        pubs.getLevelsAndValues(itemId).then(function(){
            MetadataManagerService.fillFiltersByItem(data[0].metadata);
            pubs.updateFiltersSelectedValues(data[0].metadata);
            pubs.search(itemId);
            });
        });
    };

    pubs.rebuildByUnit = function(unitId){
        MetadataManagerService.getObjectsByUnit(unitId).then(function(data){
            pubs.rebuildByItem(data[0].id);
        });
    };

    pubs.reportError = function(){
        if(pubs.selectedErrorReport != -1){
            MetadataManagerService.reportError(pubs.collectionId, pubs.item.id, pubs.selectedErrorReport).then(
            function(data){
                pubs.errorReportingStatus = pubs.collection.error_confirm;
            },
            function(data){
                pubs.errorReportingStatus = "Kunne ikke sende fejlrapporten";
            });
        }
    };


    return pubs;
});

/**
 * MetadataFilterService
 * This service is responsible for retrieving and handling the metadata levels given in
 * the central configuration object, which this service depends on.
 *
 * The main responsibilities are:
 * 1) Receive the levels of metadata from the server
 * 2) Receive the metadata for each level according to the settings
 *    (preset, typeahead, getallbyfilter) and filters given by other levels
 * 3) Report if all required filters is set
 * 4) Load image collections based on the filters set
 *
 */

//Getting the main module
var app = angular.module('KSA_Bladr.services');

app.service('MetadataManagerService', function($http, $q, URLBuilderService){
    //Private methods and variables goes here
    var privates = {};

    //Public methods and variables
    var pubs = {};

    //The level is the same as a possible filter. TODO: Change the name
    pubs.levels = [];
    pubs.metadataType = null;
    pubs.collection_id = null;
    pubs.collectionInfo = {};
    pubs._collectionInfoId = 0;

    pubs.config = function(collection_id){
        pubs.collection_id = collection_id;
    };

    pubs.getCollectionInfo = function(){
        var deferred = $q.defer();
        if(pubs._collectionInfoId !== pubs.collection_id){
            $http.jsonp(URLBuilderService.collectionInfoUrl(pubs.collection_id))
            .success(function(data, status, headers) {
                pubs.collectionInfo = data[0];
                deferred.resolve(data[0]);
            })
            .error(function(){
                deferred.reject();
                throw "Couldn't load collection info";
            });
        }
        else{
            deferred.resolve();
        }
        return deferred.promise;
    };

    pubs.getCollections = function(){
        var deferred = $q.defer();
        $http.jsonp(URLBuilderService.collectionsUrl())
            .success(function(data, status, headers) {
                deferred.resolve(data);
            })
            .error(function(){
                deferred.reject();
                throw "Couldn't load collections";
            });
            return deferred.promise;
    };

    //Retrieves metadata levels for the given collection
    pubs.getMetadataLevels = function(){
        var deferred = $q.defer();
        $http.jsonp(URLBuilderService.metadataLevelsUrl(pubs.collection_id))
        .success(function(data, status, headers) {
            pubs.loadAndOrderLevels(data);
            pubs.metadataType = data.levels_type;
            deferred.resolve(pubs.levels);
        })
        .error(function(){
            //deferred.reject();
            //throw "Couldn't load metadata levels";
            //TODO: For demonstration only:
            var data = {"type":"hierarchy","levels":[{"order":2,"gui_name":"Filmrulle","gui_description":"Der er mellem 20 og 50 filmruller pr. station. Opdelingen skyldes begr\u00e6nsningen i antallet af billeder p\u00e5 en gammeldags fotofilm","gui_info_link":"http:\/\/www.kbharkiv.dk\/wiki\/registerbladenes-filmruller","name":"roll","type":"getallbyfilter","data_sql":"SELECT id, filmrulle_navn from PRB_filmrulle WHERE station_id = %d","required_filters":["station"],"data":false},{"order":1,"gui_name":"Station","gui_description":"Der findes seks stationer baseret p\u00e5 politidistrikternes inddeling, og to baseret p\u00e5 alfabetisk sortering","gui_info_link":"http:\/\/www.kbharkiv.dk\/registerblade\/om-stationerne","name":"station","type":"preset","data_sql":false,"data":[{"name":"Station 1","id":"26"},{"name":"Station 2","id":"29"}]}]};
            pubs.loadAndOrderLevels(data);
            pubs.metadataType = data.type;
            console.log("Loaded mock metadatalevels");
            deferred.resolve();
        });

        return deferred.promise;
    };

    //Retrieves objects with the given filters
    pubs.getObjects = function(){
        var deferred = $q.defer();
        $http.jsonp(URLBuilderService.objectsUrl(pubs.collection_id, null, pubs.getFilters()))
        .success(function(data, status, headers) {
            deferred.resolve(data);
        })
        .error(function(){
            deferred.reject();
            throw "Couldn't load objects";
        });

        return deferred.promise;
    };

    //Retrieves object with the given id
    pubs.getObject = function(id){
        var deferred = $q.defer();
        $http.jsonp(URLBuilderService.objectUrl(pubs.collection_id, id))
        .success(function(data, status, headers) {
            deferred.resolve(data);
        })
        .error(function(data, status, headers, config){
            deferred.reject();
            throw "Couldn't load object with id " + id;
        });

        return deferred.promise;
    };

    //Retrieves object with the given id
    pubs.getObjectsByUnit = function(unit_id){
        var deferred = $q.defer();
        $http.jsonp(URLBuilderService.objectByUnitUrl(pubs.collection_id, unit_id))
        .success(function(data, status, headers) {
            deferred.resolve(data);
        })
        .error(function(data, status, headers, config){
            deferred.reject();
            throw "Couldn't load objects for unit_id " + unit_id;
        });

        return deferred.promise;
    };

    pubs.fillFiltersByItem = function(item){
        for(var i = 0; i < pubs.levels.length; i++){
            if(item[pubs.levels[i].name])
                pubs.levels[i].filter_value = item[pubs.levels[i].name];
        }
    };

    pubs.loadAndOrderLevels = function(data){
        pubs.levels = data;

        pubs.levels.sort(function(a,b){return a.order-b.order});

        pubs.type = data.type;
    };

    //Gets metadata for the given level based on the filters
    pubs.getMetadata = function(level){
        var deferred = $q.defer();
        var request = URLBuilderService.metadataUrl(pubs.collection_id, level, pubs.getFilters());
        var currentLevel = 0;
        var shouldGetData = false;
        for(var j = 0;j<pubs.levels.length;j++){
            //If the data has not already been loaded, or the request is updated, the data is loaded
            if(pubs.levels[j].name === level && (pubs.doRefreshMetadata(pubs.levels[j].data, request, pubs.levels[j].latest_request))){
                shouldGetData = true;
                currentLevel = j;
                $http.jsonp(request)
                .success(function(data){
                    pubs.levels[j].possibleValues = data;
                    pubs.levels[j].latest_request = request;
                    deferred.resolve({name: pubs.levels[j].name, data: data});
                })
                .error(function(){
                    throw "Could not load metadata for " + pubs.level[j].name;
                    deferred.reject();
                });
                break;
            }
        }

        //Two cases:
        //Hierarchy: Delete data in every level below the given, and receiving data for the one level below the given
        //Flat: No data is loaded as it is supposed that all data is received at once???
        if(pubs.metadataType == 'hierarchy'){
            pubs.clearMetadata(pubs.levels[currentLevel].name);
        }
        else{
            pubs.clearMetadata();
        }

        if(!shouldGetData)
            deferred.resolve();

        return deferred.promise;
    };

    pubs.getMetadataString = function(metadata){
        if(metadata){
            var metadataStr = '';
            var first = true;
            //for(var j = 0; j < metadata.length; j++){
                for(var i = 0; i < pubs.levels.length; i++){
                    if(metadata[pubs.levels[i].name] !== undefined){
                        var gui = pubs.levels[i].gui_name + ' ';
                        if(pubs.levels[i].gui_hide_name)
                            gui = "";

                        if(first){
                            first = false;
                        }
                        else{
                            gui = gui.toLowerCase();
                        }
                        if(!pubs.levels[i].gui_hide_value){
                            metadataStr = metadataStr + gui + metadata[pubs.levels[i].name] + ', ';
                        }
                    }
                }
           // }

            return metadataStr.substring(0, metadataStr.length-2);
        }
        else{
            return "";
        }
    };

    pubs.getStarbasRef = function(metadata, starbas_field_name){
        if(starbas_field_name){
            return '<a href="https://www.starbas.net/avmateriale.php?av_stam_id=' + metadata[starbas_field_name] + '" target="_blank">' + 'se i Starbas' + '</a>';
        }
        return false;
    };

    //Checks if the metadata should be updated
    pubs.doRefreshMetadata = function(data, request, latestRequest){
        if(latestRequest !== request)
            return true;

        if(data.length == 0)
            return true;

        return false;
    };

    //Returns filters in format {"name":"station","value":1}
    pubs.getFilters = function(){
        var filters = [];

        for(var i = 0; i< pubs.levels.length; i++){
            if(pubs.levels[i].filter_value !== null && pubs.levels[i].filter_value !== undefined ){
                filters.push({"name" : pubs.levels[i].name, "value" : pubs.levels[i].filter_value});
            }
        }

        return filters;
    };

    //Removes metadata for all level on or below the given level
    pubs.clearMetadata = function(inputLevel){
        var level = inputLevel || 0;

        if(level !== 0){
            for(var i = 0; i < pubs.levels.length; i++){
                if(pubs.levels[i].name == inputLevel){
                    level = i;
                    break;
                }
            }
        }

        //Removes data below the given level if data is to be received from backend
        for(var k = level; k < pubs.levels.length; k++){
            //if(pubs.levels[k].type == "preset" || pubs.levels[k].type == "getallbyfilter"){
                pubs.levels[k].possibleValues = [];
            //}
        }
    };

    pubs.changeFilterValue = function(level, value){
        pubs.removeFilter(level);
        pubs.addFilter({"name":level, "value":value});

        for(var i = 0; i < pubs.levels.length; i++){
            if(pubs.levels[i].name == level && pubs.levels[i+1] !== undefined && pubs.levels[i+1].searchable == true){
                return pubs.getMetadata(pubs.levels[i+1].name);
            }
        }
    };

    //Removes metadata filter
    pubs.removeFilter = function(filterToRemove){
        for(var i = 0; i < pubs.levels.length; i++){
            if(pubs.levels[i].name == filterToRemove)
                pubs.levels[i].filter_value = null;
        }
    };

    //Adds metadata filer
    pubs.addFilter = function(newFilter){
        if(newFilter.name === undefined || newFilter.value === undefined)
            return;
            //throw "New filter requires both name and value";

        for(var i = 0; i < pubs.levels.length; i++){
            if(pubs.levels[i].name == newFilter.name)
                pubs.levels[i].filter_value = newFilter.value;
        }
    };

    //Returns true if all required filters is set
    pubs.canRetrieveObjects = function(){
        var allRequiredFiltersSet = false;
        for(var i = 0; i<pubs.levels.length; i++){
            if(pubs.levels[i].required){
                if(!pubs.levels[i].hasOwnProperty('filter_value') ||
                    pubs.levels[i].filter_value === null ||
                    pubs.levels[i].filter_value == ""){
                    return false;
                }
            }
        }

        return true;
    };

    pubs.reportError = function(collectionId, itemId, errorId){
        var deferred = $q.defer();
        var request = URLBuilderService.errorReportUrl(collectionId, itemId, errorId);

        $http.jsonp(request)
            .success(function(){deferred.resolve();})
            .error(function(){deferred.reject();});

        return deferred.promise;
    };

    return pubs;
});

/**
 * URLBuilderService
 * This service is responsible for returning URL's based on given input and request type
 *
 */

//Retrieves the module KSA_Bladr.services, and adds a new services
angular.module('KSA_Bladr.services').
    service('URLBuilderService', function(){
        //Private methods and variables goes here
        var privates = {};

        //Public methods and variables
        var pubs = {};

        //Generic URL creator. Builds URLs based on collection id (required), metadata level and parameters
        privates.createUrl = function(collectionId, metadataLevel, parameters){
            var url = "";

            if(!collectionId || isNaN(collectionId)){
                return false;
            }

            url = "/" + collectionId;

            if(metadataLevel)
                url = url + "/" + metadataLevel;

            url = url + "?";

            parameters = parameters || false;

            var parametersAdded = false;

            //if parameters is array, add to the url
            if(parameters instanceof Array){
                for(var i = 0; i<parameters.length; i++){
                    url = url + parameters[i].name + "=" + parameters[i].value + "&";
                }
                parametersAdded = true;
            }

            url = url.substring(0, url.length-1);

            if(parametersAdded){
                url = url + "&callback=JSON_CALLBACK";
            }
            else{
                url = url + "?callback=JSON_CALLBACK";
            }

            return encodeURI(url);
        };

        //Url of the remote server, base of all requests
        pubs.remoteServerUrl = "https://www.kbhkilder.dk/1508/stable/api/";
        //pubs.remoteServerUrl = "http://localhost:8000/api/";

        pubs.collectionsUrl = function(){
            return pubs.remoteServerUrl + 'collections/' + '?callback=JSON_CALLBACK';
        };

        pubs.collectionInfoUrl = function(collectionId){
            if(!collectionId)
                return false;

            return pubs.remoteServerUrl + 'collections/' + collectionId + '?callback=JSON_CALLBACK';
        };


        pubs.metadataLevelsUrl = function(collectionId, metadataLevel, parameters){

            var url = privates.createUrl(collectionId, metadataLevel, parameters);

            if(url)
                return pubs.remoteServerUrl + "levels" + url;

            return false;
        };

        pubs.metadataUrl = function(collectionId, metadataLevel, parameters){

            var url = privates.createUrl(collectionId, metadataLevel, parameters);

            if(url)
                return pubs.remoteServerUrl + "metadata" + url;

            return false;
        };

        pubs.objectsUrl = function(collectionId, metadataLevel, parameters){

            //Parameters are mandatory
            if(!parameters || !(parameters instanceof Array ))
                return false;

            var url = privates.createUrl(collectionId, metadataLevel, parameters);

            if(url)
                return pubs.remoteServerUrl + "data" + url;

            return false;
        };

        pubs.objectUrl = function(collectionId, itemId){
            if(!collectionId || !itemId)
                throw 'Not all parameters given in objectUrl';

            var url = pubs.remoteServerUrl + "data/" + collectionId + '?id=' + itemId + '&callback=JSON_CALLBACK';
            return url;
        };

        pubs.objectByUnitUrl = function(collectionId, unitId){
            if(!collectionId || !unitId)
                throw 'Not all parameters given in objectUrl';

            var url = pubs.remoteServerUrl + "data/" + collectionId + '?unit_id=' + unitId + '&callback=JSON_CALLBACK';
            return url;
        };

        pubs.errorReportUrl = function(collectionId, itemId, errorId){
            return pubs.remoteServerUrl + "error/" + collectionId + "/" + itemId + "/" + errorId + '/?callback=JSON_CALLBACK';
        };

        return pubs;
    }
);
